import './index'
import Card from 'react-bootstrap/Card'

function App() {
  return (
    <div className="App">
      <div className="portfolioHeader">       
        <h1>Gil Pena Portfolio</h1>
      </div>
      <div className="FirstRow">
        <Card>
          <Card.Body>
            <Card.Title>Gil Pena Portfolio</Card.Title>
          </Card.Body> 
        </Card>

      </div>
    </div>
  );
}

export default App;
